import React from 'react'

export default function Filters(props) {

    let activeDiv;

    const {
        tagSelected
    } = props;

    return (
        <div className="page-filters">
            <div onClick={tagSelected} className={`filter ${activeDiv === "all" ? "active" : ""}`} data-filter="all"><span className="icon-all"></span><p>All</p></div>
            <div onClick={tagSelected} className={`filter ${activeDiv === "new" ? "active" : ""}`} data-filter="new"><span className="icon-new"></span><p>New</p></div>
            <div onClick={tagSelected} className={`filter ${activeDiv === "top" ? "active" : ""}`} data-filter="top"><span className="icon-top"></span><p>Top</p></div>
        </div>
    )
}
